    /// Get file
    pub fn get(&self, filename: &str) -> String {
        if !self.files.contains_key(filename) {
            return "404 File Not Found".to_string();
        }

        // Temp chec
        if vec!["theme/header", "theme/footer", "theme/chat", "theme/index"].contains(&filename) {
            return self.get_temp(&filename);
        }

        let html = self.files.get(filename).unwrap();
        let res_html = String::from_utf8(base64::decode(&html.as_str()).unwrap()).unwrap().to_string();
        res_html
    }

    /// Get temporary -- from file until designer done
    pub fn get_temp(&self, filename: &str) -> String {
        let cwd = env::current_dir().unwrap();
        let file_path = format!("{}/webassets/assets/{}.html", cwd.display(), filename);
        let mut html = fs::read_to_string(&file_path).unwrap();
        html = html.replace("~theme_uri~", "/static");
        html.to_string()
    }

    /// Get static page (ie. CSS, Javaascript, image)
    pub fn get_static(&self, filename: &str) -> HttpResponse {
        if !self.files.contains_key(filename) {
            return HttpResponse::new(&404, &vec![], &"404 File Not Found".to_string());
        }

        // Get file extension
        let mut ext = String::new();
        if let Some(index) = filename.rfind('.') {
            ext = filename[index + 1..].to_lowercase().to_string();
        }

        // Get mime type
        let mime_type = match ext.as_str() {
            "css" => "text/css",
            "js" => "text/js",
            "png" => "image/png",
            "jpg" | "jpeg" => "image/jpeg",
            "git" => "image/git",
            _ => "text/plain"
        };
        let headers = vec![format!("Content-Type: {}", mime_type)];

        // Get file contents
        let base64_str = self.files.get(filename).unwrap();
        let mut contents = base64::decode(&base64_str.as_str()).unwrap();
        //if !mime_type.starts_with("image") {
            let res_html = String::from_utf8_lossy(contents.as_slice()).to_string();
        //}

        HttpResponse::new(&200, &vec![], &res_html)
    }

